und-color: rgb(220, 220, 220); font-size: 15.4px;\"><div class=\"spec speclabel\" style=\"border-width: 0px 1px 0px 0px; border-top-style: initial; border-right-style: solid; border-bottom-style: initial; border-left-style: initial; border-top-color: initial; border-right-color: rgb(192, 192, 192); border-bottom-color: initial; border-left-color: initial; border-image: initial; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 189.5px;\">Brakes / Rear</div><div class=\"spec specvalue\" style=\"border: 0px; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 568.5px; background-color: rgb(255, 255, 255);\">220mm disc; Unified Brake System and ABS</div><div class=\"clear\" style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; clear: both; overflow: hidden; visibility: hidden; width: 0px; height: 0px;\"></div></div><div class=\"specrow\" style=\"border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(192, 192, 192); border-left-color: initial; border-image: initial; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; background-color: rgb(220, 220, 220); font-size: 15.4px;\"><div class=\"spec speclabel\" style=\"border-width: 0px 1px 0px 0px; border-top-style: initial; border-right-style: solid; border-bottom-style: initial; border-left-style: initial; border-top-color: initial; border-right-color: rgb(192, 192, 192); border-bottom-color: initial; border-left-color: initial; border-image: initial; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 189.5px;\">Tires / Front</div><div class=\"spec specvalue\" style=\"border: 0px; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 568.5px; background-color: rgb(255, 255, 255);\">120/70ZR17</div><div class=\"clear\" style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; clear: both; overflow: hidden; visibility: hidden; width: 0px; height: 0px;\"></div></div><div class=\"specrow\" style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; background-color: rgb(220, 220, 220); font-size: 15.4px;\"><div class=\"spec speclabel\" style=\"border-width: 0px 1px 0px 0px; border-top-style: initial; border-right-style: solid; border-bottom-style: initial; border-left-style: initial; border-top-color: initial; border-right-color: rgb(192, 192, 192); border-bottom-color: initial; border-left-color: initial; border-image: initial; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 189.5px;\">Tires / Rear</div><div class=\"spec specvalue\" style=\"border: 0px; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 568.5px; background-color: rgb(255, 255, 255);\">190/55ZR17</div><div class=\"spec specvalue\" style=\"border: 0px; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 568.5px; background-color: rgb(255, 255, 255);\"><br></div><div class=\"spec specvalue\" style=\"border: 0px; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 568.5px; background-color: rgb(255, 255, 255);\"><br></div><div class=\"spec specvalue\" style=\"border: 0px; margin: 0px; padding: 3px 6px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; position: relative; float: left; font-size: 14px; width: 568.5px; background-color: rgb(255, 255, 255);\"><ul class=\"featurevalue\" style=\"border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; list-style-type: none;\"><li style=\"border: 0px; margin: 9px 20px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; list-style-type: disc;\"><b style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; font-weight: bold;\">MotoGP?-Derived Crossplane Crankshaft Superbike</b><br>The YZF-R1? features a lightweight and compact crossplane crankshaft, inline-four-cylinder, 998cc high output engine. Featuring titanium fracture-split connecting rods, an offset cylinder block and magnesium covers, the motor delivers extremely high horsepower and a strong pulse of linear torque for outstanding performance, all wrapped in aerodynamic MotoGP?-style bodywork.</li><li style=\"border: 0px; margin: 9px 20px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; list-style-type: disc;\"><b style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; font-weight: bold;\">Class-Leading Electronics Package</b><br>The YZF-R1 features the most advanced electronics package ever offered on a supersport machine, with a full suite of interrelated technologies that enable the rider to enjoy the fullest range of performance with greater comfort, control, and ease of operation than ever before.</li><li style=\"border: 0px; margin: 9px 20px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; list-style-type: disc;\"><b style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; font-weight: bold;\">MotoGP?-Level Controllability</b><br>The YZF-R1 pioneered the use of the first six-axis Inertial Measurement Unit (IMU) ever offered on a street-going motorcycle. The IMU consists of a gyro sensor that measures pitch, roll, and yaw, as well as an accelerometer that measures acceleration in the fore-aft, up- down, and right-left directions? all at a rate of 125 calculations per second. By calculating each signal, the IMU finds the precise vehicle position and movement, and communicates it to the ECU, enabling it to control the bike?s systems.</li><li style=\"border: 0px; margin: 9px 20px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; list-style-type: disc;\"><b style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; font-weight: bold;\">Digital Rider Aids</b><br>The YZF-R1 is fully equipped with banking-sensitive Traction Control and unified ABS, as well as Slide Control, Launch Control, and more. The Quick Shift System provides both up and downshifting ability, automatically matching engine speed on downshifts for rapid clutchless shifts in either direction. The Wheel Lift Control system smoothly intervenes for maximum forward drive.</li><li style=\"border: 0px; margin: 9px 20px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; list-style-type: disc;\"><b style=\"border: 0px; margin: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; font-weight: bold;\">Deltabox? Chassis</b><br>Advanced aluminum Deltabox? frame uses the engine as a stressed member of the chassis and is designed to provide optimum longitudinal, lateral and torsional rigidity balance. Fully adjustable suspension front and rear provides exceptional road-holding and tuneability.</li></ul><p style=\"border: 0px; margin: 9px 20px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; list-style-type: disc;\"><br></p><p style=\"border: 0px; margin: 9px 20px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; margin-inline-start: 0px; margin-inline-end: 0px; list-style-type: disc;\"><img src=\"data:image/jpeg;base64,', 16000.00, 14500.00, '[{\"name\":\"choice_0\",\"title\":\"Engine\",\"options\":[\"1000 cc\",\"600 cc\",\"300 cc\"]},{\"name\":\"choice_1\",\"title\":\"Transmission\",\"options\":[\"5 Gear\",\"6 Gear\"]}]', '[\"#000000\",\"#0000FF\",\"#FF0000\"]', '{\"Black-1000cc-5Gear\":{\"price\":\"16000\",\"sku\":\"YRs-Black-1000cc-5Gear\",\"qty\":\"10\"},\"Black-1000cc-6Gear\":{\"price\":\"16500\",\"sku\":\"YRs-Black-1000cc-6Gear\",\"qty\":\"10\"},\"Black-600cc-5Gear\":{\"price\":\"16000\",\"sku\":\"YRs-Black-600cc-5Gear\",\"qty\":\"10\"},\"Black-600cc-6Gear\":{\"price\":\"16500\",\"sku\":\"YRs-Black-600cc-6Gear\",\"qty\":\"10\"},\"Black-300cc-5Gear\":{\"price\":\"16000\",\"sku\":\"YRs-Black-300cc-5Gear\",\"qty\":\"10\"},\"Black-300cc-6Gear\":{\"price\":\"16500\",\"sku\":\"YRs-Black-300cc-6Gear\",\"qty\":\"10\"},\"Blue-1000cc-5Gear\":{\"price\":\"16